import React from 'react';
export function LeftSideBar() {
    return (
        <section id="three" class="wrapper">
            <div class="inner">
                <header class="align-center">
                    <p>LeftSideBar</p>
                </header>
            </div>
        </section>
    );
};

export function RightSideBar() {
    return (
        <div className="align-center">
            <p>RightSideBar</p>
        </div>
    );
};
export function NoSideBar() {
    return (
        <div >
            <p>NoSideBar</p>
        </div>
    );
};
